(6, 4, '进口年货异军突起', '金帅', '<p style="text-indent:2em;margin:0px;">\r\n	<span style="color:#003399;font-size:14px;">随着居民生活水平的逐步提高，大家已不再满足于传统年货的单一性，将进口食品也纳入了“年货消费版图”。市民王张士已经连续两年从网上购买年货了，包括各种水果、零食、食用油、保健品等。她笑着对记者说，这些进口食品包装精美，口味也不错，而且网上购买很方便价格也不是太贵，过年了买点回来自己吃或者送人都很合适。</span>\r\n</p>\r\n<br />\r\n<p style="text-indent:2em;margin:0px;">\r\n	<span style="color:#003399;font-size:14px;">除了网购，实体店里进口年货也是应有尽有。“近年来，进口食品卖得越来越火，特别是春节前一段时间。”城南街一家进口食品店的服务人员介绍，近几年进口食品逐渐进入人们的生活，价格也越来越“亲民”，这成为其逐渐跻身市民年货清单的重要原因。</span>\r\n</p>\r\n<br />\r\n<p style="text-indent:2em;margin:0px;">\r\n	<span style="color:#003399;font-size:14px;">此外，从消费习惯变化而言，随着工作与生活压力的加大，市民对保持健康与生活品位的需求日益迫切，饮食品位也从过去的温饱型逐渐向营养型、健康型、休闲型和体验型转变，市民往往追求健康、美味的食品，要求可选择的种类越多越好，市场的需求巨大。这时，进口食品逐渐进入国门，并日渐受宠。</span>\r\n</p>\r\n<br />', 0, 255, 1417532086, 0, 1, '', '', ''),
(7, 4, '2015上海年货展销会-优质农产品展销会', '金帅', '<p>\r\n	<span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="background-color:#ffffff;color:#003399;font-size:16px;">2015上海华东六省一市优质农副产品交易会暨老字号年货博览会&nbsp;</span>\r\n</p>\r\n<p>\r\n	<span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp;&nbsp;&nbsp;&nbsp; 2015上海年货展销会/2015中国年货会&nbsp;</span>\r\n</p>\r\n<p>\r\n	<span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp; </span><span style="background-color:#003399;font-size:16px;"><span style="background-color:#ffffff;color:#003399;">&nbsp;&nbsp; 时间：2015年1月27日-2月2日</span><span style="background-color:#ffffff;"><span style="background-color:#ffffff;"></span></span></span>\r\n</p>\r\n<p>\r\n	<span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp;&nbsp;&nbsp; </span><span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp;</span><span style="background-color:#ffffff;color:#003399;font-size:16px;">地点：上海光大会展中心</span>\r\n</p>\r\n<p>\r\n	<span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp;</span><span style="background-color:#ffffff;color:#003399;font-size:16px;">&nbsp;&nbsp; 上海华东六省一市优质农副产品交易会暨老字号年货博览会将于2015年1月27日-2月2日在上海光大会展中心隆重召开。本届展览会以“食品安全与品牌推介”为宗旨，树立“民以食为天，食以安为先”的基本概念，集中展示各省市区农业发展最新成就，将绿色特色农业优秀产品全方位推介宣传，维护和打开通路，搭建合作和交流平台。展示国家级、省级农业龙头企业品牌形象，扩大市场占有份额，加强合作、互利互赢，为开拓上海及华东市场提供一个良好商机。同时向上海市民推介优质、纯天然、无公害、有机健康的绿色食品。本届农博会以“品牌、绿色、合作、发展”为主题，邀请了来自全国400家企业参展，展出面积近1万平米，本次我们将立足上海辐射全国，为各地特色产品搭建桥梁，为各参展企业提供一个全面开拓国内外市场的商机，邀请更多国内外大型采购商、高端消费者、进出口企业采购商和</span><span style="background-color:#ffffff;color:#003399;font-size:16px;">数百名境外客商汇聚盛会。</span>\r\n</p>\r\n<p>\r\n	<span style="color:#003399;font-size:small;">展示范围：农副产品、炒货、糖果糕点、家居喜庆、干果干货、酒水饮料、日用品等！</span>\r\n</p>', 0, 255, 1417532806, 0, 1, '', '', ''),
(8, 4, '2015天津年货展销会|天津网络年货会|天津年货大集', '金帅', '<strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">时</span></strong><strong><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"> &nbsp;</span></strong><strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">间：</span></strong><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">2015</span><span style="line-height:150%;color:black;font-size:15pt;">年</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">12</span><span style="line-height:150%;color:black;font-size:15pt;">月</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">20</span><span style="line-height:150%;color:black;font-size:15pt;">日</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">-2</span><span style="line-height:150%;color:black;font-size:15pt;">月</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">10</span><span style="line-height:150%;color:black;font-size:15pt;">日</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"></span> \r\n<p>\r\n	<b><span style="line-height:150%;color:black;font-size:15pt;">口</span></b><b><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"> </span></b><b><span style="line-height:150%;color:black;font-size:15pt;">号：</span></b><span style="line-height:150%;color:black;font-size:15pt;">上万种年货</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">-</span><span style="line-height:150%;color:black;font-size:15pt;">一站式采购</span><b><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span></b>\r\n</p>\r\n<p>\r\n	<strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">网</span></strong><strong><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"> </span></strong><strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">站：</span></strong><span style="line-height:150%;color:black;font-size:15pt;">天津必购年货网（</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">http://www.58bigou.com</span><span style="line-height:150%;color:black;font-size:15pt;">）</span><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p>\r\n	<strong><span style="font-family:宋体;color:black;">展会简介</span></strong><span style="color:black;">：</span><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p style="text-indent:24pt;">\r\n	<span style="color:black;">天津必购年货节全称为：【天津市新春年货网络购物节】，是</span><span style="font-family:simsun;color:black;">58</span><span style="color:black;">必购年货网针对天津地区举行的大型年货网络采购大会，现已发展成为环渤海地区规模最大、档次最高、影响最广的知名年货网络采购盛会，在</span><span style="font-family:simsun;color:black;"><a href="http://baike.baidu.com/view/99548.htm"><span style="font-family:宋体;color:black;text-decoration:none;"><span>消费者</span></span></a></span><span style="color:black;">心中也留下了良好的口碑，成为了天津每年不可缺少的购物盛景。</span><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p style="text-indent:24pt;">\r\n	<span style="font-family:simsun;color:black;">2015</span><span style="color:black;">天津年货网络购物节会由</span><span style="font-family:simsun;color:black;">58</span><span style="color:black;">必购年货网联合淘宝、天猫大型网购平台，聚合</span><span style="font-family:simsun;color:black;">3000</span><span style="color:black;">多家优质年货供应商，以最大的折扣价（全场</span><span style="font-family:simsun;color:black;">1</span><span style="color:black;">折起）为广大天津消费者提供：南北炒货、优质坚果、干果、进口水果、各式糕点、粮油米面、各地方土特产、美食小吃、日用品、美酒咖啡、腊肉香肠、茶叶冲饮等</span><span style="font-family:simsun;color:black;">5000</span><span style="color:black;">多种商品。这将为更多企业提供更多的年货宣传、销售的渠道，也为广大消费者提供了一站式采购年货的便利。</span><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p style="text-indent:30pt;">\r\n	<span style="color:black;">武汉鸭脖子、山西大枣、四川腊肠、东北木耳、无锡排骨、临安手剥山核桃、宁波年糕等等……只需轻点鼠标，不出家门就能购买到各地特产。天津</span><span style="font-family:simsun;color:black;">-58</span><span style="color:black;">必购年货网以全新的服务理念、丰富多彩的促销活动（积分送大奖）、全方位的广告宣传将天津年货网购节办成集</span><span style="font-family:simsun;color:black;">“</span><span style="color:black;">优质、丰富、便捷</span><span style="font-family:simsun;color:black;">”</span><span style="color:black;">为一体的全网知名展会！</span><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"> <span></span></span>\r\n</p>\r\n<p>\r\n	<span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p>\r\n	<b><span style="line-height:150%;color:black;font-size:13.5pt;">展示范围：坚果、干货、干果、水果、水产、南北炒货、地方特产、粮油、进口食品、酒类、饮料、茶叶、礼包礼盒、糖果蜜饯、糕点、日用品、喜庆用品、腌腊佐料等！</span></b><b><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span></b>\r\n</p>\r\n<p>\r\n	<strong><span style="font-family:simsun;color:black;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></strong>\r\n</p>', 0, 255, 1417611274, 0, 1, '', '', ''),
(9, 4, '2015苏州年货展销会|苏州网络年货会|苏州年货大集|年货团购', '金帅', '<p>\r\n	&nbsp;苏州年货团购网、苏州年货网、苏州年货展销会\r\n</p>\r\n<p>\r\n	<strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">时</span></strong><strong><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"> &nbsp;</span></strong><strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">间：</span></strong><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">2015</span><span style="line-height:150%;color:black;font-size:15pt;">年</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">12</span><span style="line-height:150%;color:black;font-size:15pt;">月</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">20</span><span style="line-height:150%;color:black;font-size:15pt;">日</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">-2</span><span style="line-height:150%;color:black;font-size:15pt;">月</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">10</span><span style="line-height:150%;color:black;font-size:15pt;">日</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"></span>\r\n</p>\r\n<p>\r\n	<b><span style="line-height:150%;color:black;font-size:15pt;">口</span></b><b><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;"> </span></b><b><span style="line-height:150%;color:black;font-size:15pt;">号：</span></b><span style="line-height:150%;color:black;font-size:15pt;">上万种年货</span><span style="line-height:150%;font-family:simsun;color:black;font-size:15pt;">-</span><span style="line-height:150%;color:black;font-size:15pt;">一站式采购</span><b><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span></b>\r\n</p>\r\n<p>\r\n	<strong><span style="line-height:150%;font-family:宋体;color:black;font-size:15pt;">网</span></strong><strong><span style="line-he