-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p style="text-indent:30pt;">\r\n	<span style="color:black;">武汉鸭脖子、山西大枣、四川腊肠、东北木耳、无锡排骨、临安手剥山核桃、宁波年糕等等……只需轻点鼠标，不出家门就能购买到各地特产。<span style="color:black;">苏州</span></span><span style="font-family:simsun;color:black;">-58</span><span style="color:black;">必购年货网以全新的服务理念、丰富多彩的促销活动（积分送大奖）、全方位的广告宣传将<span style="color:black;">苏州</span>年货网购节办成集</span><span style="font-family:simsun;color:black;">“</span><span style="color:black;">优质、丰富、便捷</span><span style="font-family:simsun;color:black;">”</span><span style="color:black;">为一体的全网知名展会！</span><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"> <span></span></span>\r\n</p>\r\n<p>\r\n	<span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span>\r\n</p>\r\n<p>\r\n	<b><span style="line-height:150%;color:black;font-size:13.5pt;">展示范围：坚果、干货、干果、水果、水产、南北炒货、地方特产、粮油、进口食品、酒类、饮料、茶叶、礼包礼盒、糖果蜜饯、糕点、日用品、喜庆用品、腌腊佐料等！</span></b>\r\n</p>\r\n<p>\r\n	<b><span style="line-height:150%;color:black;font-size:13.5pt;">58必购网欢迎你的光临和惠顾！</span></b><b><span style="line-height:150%;font-family:simsun;color:black;font-size:13.5pt;"></span></b>\r\n</p>', 0, 255, 1417611632, 0, 1, '', '', ''),
(10, 4, '2015南京年货展销会 南京年货团购会 南京年货大集 年货价格', '金帅', '<p>\r\n	<span style="white-space:nowrap;"><span style="white-space:nowrap;">赣南脐橙、新疆红枣、南北炒货、武汉鸭脖、礼品礼包、阳澄湖大闸蟹、茶叶冲饮、地方土特产、琳琅满目的糖果 各色糕点、时令美食、休闲食品、各种新鲜水果、腌腊鱼肉、中高档名酒等等。南京年货58必淘为广大南京市民提供上万种绿色、安全、优质、美味的各种年货美食，让你足不出户即可享受网上采购年货的便利，同时还有送积分、积分换礼品、积分大抽奖等活动等着你！</span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style="white-space:nowrap;">春节是中国一年中最大、最喜庆的传统节日，是中国人最重要的节日。春节前夕，是众多单位和广大市民在忙碌了一年后消费量最大、消费最为集中的时节。本次年货展会给众多单位和广大市民提供一个集中采购春节商品的最佳平台，同时也为广大厂商提供一个展示企业风采、销售企业产品的绝好机会。此次年货会将联合淘宝、天猫等大型平台上的3000多家优质供货商，拿出最好的产品、以最低的折扣价提供给广大消费者，真正为广大消费者和企事业单位营造一个“优质、安全、省心、放心”的一站式年货采购环境。</span> \r\n</p>', 0, 255, 1418266747, 0, 1, '', '', ''),
