(56, 5, 'SIR7品牌介绍 SIR7品牌故事 SIR7品牌简介', '小编', '<p>\r\n	<span class="headline-content">品牌简介</span>\r\n</p>\r\n<p>\r\n	<span class="headline-content">SIR7 ，源自欧洲的设计理念，是上海面对面服饰有限公司旗下的主要品牌之一。SIR7服饰坚持着一贯的舒适与原<br />\r\n　　SIR7logo<br />\r\n　　创，致力向社会大众提供感性、前卫、自由气息的时尚服饰。<br />\r\n2、品牌故事</span>\r\n</p>\r\n<p>\r\n	<span class="headline-content"><a href="http://58bitao.com/index.php?m=index&amp;a=cate&amp;cid=33&amp;p=2" target="_blank">SIR7</a>中文名叫面对面。天使LOGO象征快乐，和谐。一阴一阳之何谓矣。主要以开发，生产，销售男装。F是face脸的缩写，古话说树活张皮，人活张脸。男人一定要脸面。SIR7代表更要脸，所以说男人穿着很重要。穿出你的尊严，穿出你的自信。<br />\r\n　　<br />\r\n3、品牌定位</span>\r\n</p>\r\n<p>\r\n	<span class="headline-content">人群定位28—40岁都市中向往和拥有高品味和高品质的中青年。他们对于生活的态度是严谨的，对待细节是认真的，对待承诺是恪守的，他们关注世界动向，勇于接受挑战，是各个专业领域的精英，并热衷于追求国际化、都市化的精英形象。他们视SIR7品牌为存在已久的传统及保守的形象的积极转变。<br />\r\n　　<br />\r\n4、品牌承诺</span>\r\n</p>\r\n<p>\r\n	<span class="headline-content">年轻时尚，舒适生活从SIR7开始。<br />\r\n　　<br />\r\n5、设计理念</span>\r\n</p>\r\n<p>\r\n	<span class="headline-content">SIR7源自欧洲的男士时装设计理念品牌。他带来欧洲最新的流行趋势，国际最IN的潮流发展，强调不凡的个性和积极的生活态度。SIR7强调设计理念的个性化，完美的将都市轻熟男的活力、自信、精明、快乐、男性气质淋漓精致地展现出来，充满无限的时尚感，品牌服装整体感觉富有内涵，让男士无论是在商务，还是在休闲场合都能充满自信的展示自我。<br />\r\n6、品牌特色 </span>\r\n</p>\r\n<p>\r\n	<span class="headline-content">SIR7是为喜欢穿着流行和时尚的都市男士们设计的。SIR7的设计迎合了国际大都市男士的生活品位，他们喜欢独特、轮廓鲜明而朴实的服装风格，同时喜欢用高品质和新颖的面料制作的服装。SIR7时尚品牌自问世以来，以其简洁纯粹的风格吸引了全球追求时尚的男性的目光，是代表了欧洲时尚潮流男装的品牌。</span>\r\n</p>\r\n<div class="para">\r\n	<sup></sup></a><br />\r\n<br />\r\n</a>\r\n</div>', 0, 255, 1419430325, 0, 1, '', '', ''),
(57, 5, '浙江棉田针织有限公司简介 棉田针织旗舰店 棉田针织品牌介绍', '小编', '<p>\r\n	&nbsp;&nbsp;&nbsp; 浙江棉田针织有限公司创建于2003年，坐落于经济飞速发展的中国商贸之都—浙江义乌。是一家专业从事无缝服装设计、生产与销售的现代化企业。同时也是国内无缝内衣行业最具竞争实力的企业之一。棉田一直致力于无缝服装事业，在无缝产业的投资力度和新技术力量的率先使用上，均成为整个行业的佼佼者。公司一方面在硬件上投入巨资，全套引进世界领先的意大利圣东尼公司SM8TOP2、MF8全电脑无缝提花针织机共.\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp; 浙江棉田针织有限公司创建于2003年，坐落于经济飞速发展的中国商贸之都—浙江义乌。是一家专业从事无缝服装设计、生产与销售的现代化企业。同时也是国内无缝内衣行业最具竞争实力的企业之一。棉田一直致力于无缝服装事业，在无缝产业的投资力度和新技术力量的率先使用上，均成为整个行业的佼佼者。公司一方面在硬件上投入巨资，全套引进世界领先的意大利圣东尼公司SM8TOP2、MF8全电脑无缝提花针织机共80余台，并引进日本、意大利全电脑拼档衣车200多台，以及染色、烘干、定型等系列设备，为生产符合现代时尚消费新潮的产品打下了良好基础。目前棉田年生产能力已达到1000余万件（套），已形成集约化的生产规模。\r\n</p>', 0, 255, 1419430716, 0, 1, '', '', ''),
(58, 5, '施德里服饰简介 施德里服饰旗舰店 施德里服饰品牌介绍', '小编', '<p>\r\n	<strong><span style="font-size:18px;">施德里服饰简介 施德里服饰旗舰店</span></strong><span style="font-size:14px;"></span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">施德里服饰旗舰店是广州壹赏购贸易有限公司在天猫开设主营服装的购物平台；致力于为男士打造酷尚有型的潮流风向标，提供包括短袖t恤、POLO衫、衬衫、休闲裤、牛仔裤等产品。</span>\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;"><strong>顾客评价：</strong></span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">东西质量很好 样子跟图片一样！物流也很给力。感觉像相当不错，下次还来光顾。物超所值，赞一个。</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">物流发货快，包装严实、仔细，宝贝质量好，与卖家描述一样，我十分满意，商家服务好，值得推荐！</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">太让人意外了，这么便宜的价格，衣服质量这么好。比外面实体店买的都好。穿着很舒服，款式也帅。客服绵绵态度非常好，物流也好快。2天就到了。在买Tt恤你们店一定是我首选。很 满意的一次网购，祝店家生意兴隆，加油加油！！！！在来一定要打折哈。</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">发货速度，价格还公道，谢谢卖家送的小礼品，对你店的服务很满意，下次会推介好友来的，是纯棉的。</span>\r\n</p>', 0, 255, 1419431000, 0, 1, '', '', ''),
(59, 5, '缤慕男装品牌介绍 缤慕男装简介 缤慕男装设计风格', '小编', '<span style="color:#003399;font-size:16px;">&nbsp;&nbsp;&nbsp;&nbsp; <strong>缤慕男装以简洁、个</strong>性、前卫的设计元素为卖点，更加入幽默风趣、狂放的元素，以独立创新的个性设计为基调，融合国际潮流文化，演绎现代混搭风格。在设计上，则大量运用各种具有弹性的材质，通过修身的剪裁、大胆的色彩点缀、细节的处理等方法让产品体现时尚而不张扬，流行而不类同的独特风格，充分展现时尚潮人的需求，体现时尚“潮”文化。</span><br />\r\n<span style="color:#003399;font-size:16px;">&nbsp;&nbsp;&nbsp;&nbsp; <strong>缤慕服饰通过时尚休</strong>闲与英伦嬉皮士等多元素的混搭，打破固有的男装风格，以缤纷跳跃的色彩为主，简洁中流露出服饰的高质量、高品质、同时对面料及细节一丝不苟的追求精神，令缤慕在多彩世界中演绎时尚，为都市青年演绎多情、浪漫、独立、自信、帅气与幽默的多重气质，帮助他们表达自我主张，释放独具个性的吸引力。</span>', 0, 255, 1419431249, 0, 1, '', '', ''),
(60, 5, '古由卡男装 古由卡服饰简介 古由卡品牌介绍 古由卡男装旗舰店', '小编', '<p>\r\n	<span style="font-size:14px;">&nbsp;&nbsp; <strong>古由卡（Gu</strong>uka）是古由卡电子商务有限公司自主创立的时尚男装品牌；该公司于2005年创立于亚洲知名服装市场福建石狮市，致力于提供客户“快捷购物、完美体验、优质服务”。为从事电子商务和想从事电子商务的创业者提供最具保障力的后勤力量。古由卡永远坚信为梦想者创建，则成就梦想者。古由卡立志为世界提供潮流时尚的产品，为中国男装市场的注入新生力量。</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">&nbsp; <strong>“古由卡</strong>”是源于韩文“ ”的翻译，而“ ”是品牌创始人吴仕艺在韩国首尔与当时一群潮流达人的顶级设计师一起创办的工作室，为韩国的时尚达人设计他们的专属服装。就在工作室最成功的时候，品牌创始人吴仕艺毅然回国带 </span><br />\r\n<span style="font-size:14px;">古由卡（服装展示）(23张)</span><br />\r\n<span style="font-size:14px;">着最顶尖的时尚理念结合当下中国主体潮流创办出新生代“ ”——古由卡。</span><br />\r\n<span style="font-size:14px;">这是一场男装革命，“古由卡”创始人吴仕艺标榜的服装理念：新生代——无关年龄——只关心态，打开新的男装体验。</span><br />\r\n<span style="font-size:14px;"><strong>“古由卡”</strong>立志开创一个时尚风向标的一流品牌，以最具性价比的时尚服饰打造属于新生代的着装风格。</span><br />\r\n<span style="font-size:14px;"><strong>“古由卡”</strong>服饰注入了韩国不同风格的时尚元素，立志开创全新的“古由卡”新生代的时尚元素，把握住潮流的命脉。</span>\r\n</p>', 0, 255, 1419431630, 0, 1, '', '', ''),
(61, 5, '蒂拉芙服装公司简介 蒂拉芙服装公司品牌介绍 蒂拉芙服装公司发展历史', '小编', '<p>\r\n	<span style="font-size:16px;">公司简介：</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:16px;">&nbsp;&nbsp; 蒂拉芙服装公司正是一家对外贸易的服装加工工厂，公司大楼一开始一直与欧美等地服装企业合作，负责代工潮流服饰，本世纪初曾是广州最大的服装贸易对外加工企业。</span>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style="font-size:16px;">&nbsp;&nbsp; 蒂拉芙男装诞生于时尚之都广州，办公环境位于服装产业的源头。一向秉承于发展求生存，进步中寻求发展根基，脚踏实地，以品质为第一生命线，传承诚信的商业传统。确保第一生产线永远是最高品质，最完美的产出。与国际一线时尚品牌同步，专业的设计团队，每一季度都殚精竭虑务求尽善尽美，奉献出每一件时尚男装。</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:16px;">&nbsp;&nbsp; 蒂拉芙男装以电商模式，在互联网服装产业的大背景下，树立适合国人喜好的时尚潮流男装品牌。以一流的性价比，和完善的客户体验竞争市场。正在逐步成为网民购买服装的首选品牌。</span>\r\n</p>', 0, 255, 1419432059, 0, 1, '', '', ''),
(62, 5, 'PKbuyER品牌介绍 PKbuyER男装 PKbuyER简介', 'PKbuyER', '<p>\r\n	<span style="font-size:14px;">&nbsp;<strong>PKbuyER品牌介绍 </strong>&nbsp; <strong>PKbuyER男装 <strong>PKbuyER发展历史</strong></strong></span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">&nbsp;&nbsp; <strong>PKbuyER</strong> 著名时装品牌PKbuyER创立于1999年,由意大利人查森.杰克逊创建,查森.杰克逊顺应电子商务发展高瞻远瞩创立了这个品牌，在意大利的电子商务领域有着较大的影响力,影响着狂热的服装爱好者，1997年，22岁的查森.杰克逊的夫人到巴黎学艺术史，一边学服装设计。1998年，第一次发表服装秀，立刻为时装界带来一股清新之风，99年查森.杰克逊和他的夫人认识了，并一拍即合，成立的专注于电子商务销售模式的服装公司，并在3年之内爆发式的成为全国最大的网络服装品牌。剪裁精巧的"PKbuyER"男女装总是以鲜亮的颜色以及设计风格赢得时尚名流的喜爱，独树一格的服装概念，创造出另一层面的美丽定义。融合了当时所有重要的流行元素。2005，<strong>PKbuyER（品牌介绍）</strong>开始扩充他的副线品牌，除了代表高级时装的“Aristocracy PKbuyER”以外，他还陆续推出了面向年轻人的成衣品牌,另外，还有滑雪衣、高尔夫球装系列等等。"PKbuyER"品牌服装的面料都相当昂贵，为了满足大众对品牌的需求，稍便宜的副牌服装使用的面料多为最新技术合成纤维，外人难以仿制。</span><br />\r\n<span style="font-size:14px;">　　</span><br />\r\n<span style="font-size:14px;">&nbsp;&nbsp; 在将艺术创意与商业运作相结合方面，查森.杰克逊一直是位大师。他的成衣利润在业内是很高的，虽然他开拓了大量新的产品线，但其品牌一直不掉价。时至今日，查森.杰克逊公司的业务已遍及一百多个国家和地区，其产品种类除了服装外，还包括领带、眼镜、丝巾、皮件、鞋子、香氛等，这些配件也和服装一样，无不讲求精致的质感与简单的线条，透露着"PKbuyER"的“随意优雅”。</span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">&nbsp;&nbsp; 2010年，PKbuyER品牌正式进入中国，由温州康凡服饰有限公司引进，销售模式依然是依托电子商务，他们首先在国内寻找最好的代工厂，其生产方式与国内品牌美特斯邦威，森马这些类似，但是销售模式没有采取传统的实体店经营模式，而是沿用其原创的电子商务模式营销。</span>\r\n</p>', 0, 255, 1419432490, 0, 1, '', '', ''),
(63, 3, '多久能查到我的淘宝返利订单？', '小编', '<span style="widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:14px/23px Verdana;white-space:normal;orphans:2;float:none;letter-spacing:normal;color:#333333;word-spacing:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;">正常情况下，在淘宝网“确认收货”后48小时之内即可到聚来宝查看返利。如果发生意外情况，比如淘宝网维护，或者58必淘本身网站维护，我们会提前公告通知。</span>', 0, 255, 1419513151, 0, 1, '', '', ''),
(64, 3, '什么是购物返利？', '小编', '<span style="widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:13px/23px Verdana;white-space:normal;orphans:2;float:none;letter-spacing:normal;color:#333333;word-spacing:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;"><span style="widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;display:inline !important;font:13px/23px Verdana;white-space:normal;orphans:2;float:none;letter-spacing:normal;color:#333333;word-spacing:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;"><span style="font-size:14px;">会员通过58必淘</span><span style="font-size:14px;">去各天猫</span><span style="font-size:14px;">商城或淘宝上购物，购物完成后，</span><span style="font-size:14px;">58必淘</span><span style="font-size:14px;">可从天猫</span><span style="font-size:14px;">商城得到</span><span style="font-size:14px;">一定比例的销售提成，58必淘</span><span style="font-size:14px;">再把提成与自己的会员分享，这就是购物</span><span style="font-size:14px;">返利的来源，丝毫不会影响您在各购物网站的权</span><span style="font-size:14px;">益。 您或许会问：“你们是不是把价格提高然后再出售给消费者？”当然不是！58必淘</span><span style="font-size:14px;">本身不出售任何商品，具体交易的所有流程均在合作商城进行。</span></span></span>', 0, 255, 1419513557, 0, 1, '', '', ''),
(65, 5, '欧比森简介 欧比森男士服装 欧比森品牌介绍 欧比森旗舰店', '小编', '<div class="para">\r\n	<span style="font-size:16px;"><strong>欧比森品牌</strong>的设计思想来源于意大利古罗马的风情男装，在中国主打中国服饰风格系列。</span>\r\n</div>\r\n<span style="font-size:16px;">其主打产品主要为男士服装，包括不同风格的长、短袖衬衣，T恤、牛仔裤、西服等系列产品。各款产品均采用进口面料制作。</span><br />\r\n&nbsp;\r\n<div class="para">\r\n	&nbsp;\r\n</div>', 0, 255, 1419516072, 0, 1, '', '', ''),
(66, 5, '恒源祥品牌介绍 恒源祥简介 恒源祥发展历程', '小编', '<div id="card-container" class="mod-top">\r\n	<div class="card-summary nslog-area clearfix" data-nslog-type="72">\r\n		<div class="card-summary-content">\r\n			<div class="para">\r\n				<span style="font-size:14px;"><strong>&nbsp;&nbsp;&nbsp;&nbsp; 恒源祥</strong>，创立于1927年的中国上海，产品涵益绒线、针织、服饰、家纺等大类，绒线，羊毛衫综合销量常年保持同行业第一。作为中国乃至全球羊毛使用量最大的企业之一，恒源祥年羊毛使用量达10000吨以上，世界上每十只羊的羊毛就有一只供恒源祥使用。恒源祥既是中国进入市场经济后最早实施品牌运营的企业(1991年)，又是中国最早进行特许经营的企业(1999年)。目前拥有,100余家 率为100%，地、市级市场网点玻盖率超过90%，县级市场网点覆盖率超过60%。</span>\r\n			</div>\r\n			<div class="para">\r\n				<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; <strong>恒源祥诞生于1</strong>927年，创始人沈莱舟先生开办了“恒源祥人造丝毛绒线号”，在此后的近80年的历史过程中恒源祥先后经历了四次重大的转型：</span>\r\n			</div>\r\n			<div class="para">\r\n				<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; 1935年的第一次转型：专业化转型，奠定了产业基础。确立了以手编毛线为主营业务的地位，基本放弃人造丝业务。在发展零售、批发业务的基础上建立自己的工厂。这次转型使恒源祥在1935年以后的几年当中得到了迅猛的发展。</span>\r\n			</div>\r\n			<div class="para">\r\n				<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; 1956年的第二次转型：收缩形转型，产权关系发生转变。随着</span><span style="font-size:14px;">社会步入计划经济年代，1956年的恒源祥经历了公私合营，这让恒源祥的产权关系发生了重大改变，其业务领域也大副收缩，从一个涉足毛纺、织布、染整及其他相关联的产业的企业又变成了一家毛线商店。这次转型，使恒源祥进入了沉睡期。</span>\r\n			</div>\r\n			<div class="para">\r\n				<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; 1991年的第三次转型：战略性转型，恒源祥品牌诞生、建立战略联盟。随着“恒源祥”成功注册为商标，宣告“恒源祥”品牌的正式诞生。同时恒源祥运用战略联盟，构建了虚拟特许经营的运作模式。这让恒源祥手编毛线在短短的五年中得到飞速的发展，成为中国也是世界上最大的手编毛线的产销企业。</span>\r\n			</div>\r\n			<div class="para">\r\n				<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; 1998年的第四次转型：延伸形转型，确立了现代恒源祥的产业框架。手编毛线所创造的利润空间，已经无法支撑一个市场的品牌，在手编毛线领域取得的巨大成功使恒源祥拥有了向其它产业拓展的基础。1998年恒源祥正式向纺织行业中的针织、服装、家用纺织品，以及相关联的羊毛洗涤剂产业进行延伸并取得了成功。</span>\r\n			</div>\r\n			<div class="para">\r\n				<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; 历经四次转型的恒源祥脱胎换骨。目前，恒源祥羊毛衫已经连续3年保持中国第一，很多产业已经步入中国前10名的行列。今天的恒源祥正在用自己创造的盈利模式飞速地发展着。</span>\r\n			</div>\r\n			<div class="para">\r\n				&nbsp;\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>', 0, 255, 1419516590, 0, 1, '', '', ''),
(67, 5, '特步品牌简介 特步旗舰店 特步体育用品 特步品牌介绍', '小编', '<p>\r\n	<span style="font-size:14px;">&nbsp;&nbsp;&nbsp; </span><span style="font-size:14px;"><strong>特步</strong>成立于2001年，是一家大型时尚运动体育用品企业。特步采用差异化营销战略，首创偶像艺人代言体育用品并取得了空前成功。目前，公司已有员工5800人，经销网点遍布全国各地。2008年在香港上市，进入全新的发展阶段。</span><br />\r\n<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-size:14px;"><strong>特步</strong>（中国）有限公司位于中国福建省泉州市清濛五里工业园区德泰路431号，是一家集综合开发、生产和销售运动鞋、服、包、帽、球、袜为主业的大型体育用品企业。</span><br />\r\n<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-size:14px;">2001年，公司总裁丁水波以敏锐独到的眼光，创立了国内第一家时尚运动品牌——特步，并首创娱乐明星代言体育用品的全新模式，为特步<strong>品牌</strong>塑造起时尚、叛逆、特立独行的个性，推动了特步品牌差异化战略的实施，引领特步迈进了崭新的年代。随着公司经营规模的不断壮大，销售市场的蓬勃发展，特步在行业的领军地位不断稳固，特步已成为中国<strong>体育用品</strong>中的时尚流派的代表。公司现有员工5800人，拥有45条国际领先的针车流水线，10条成型流水线，在中国大陆各个省、直 辖市、自治区均设立了分公司，网点遍布全国各地。在努力拓展国内市场的同时，特步亦以高瞻远瞩的商业战略眼光瞄准全球市场，产品曾经远销世界五大洲40多个国家和地区，深受全球客商的一致信赖和好评，创国内同行业出口创汇水平之首。</span>\r\n</p>', 0, 255, 1419516990, 0, 1, '', '', ''),
(68, 5, '福顺缘旗舰店 福顺缘品牌介绍 福顺缘简介', '小编', '<h1>\r\n	<span style="font-size:14px;">福顺缘旗舰店 福顺缘品牌介绍 福顺缘简介</span>\r\n</h1>\r\n<h1>\r\n	<span style="font-size:14px;">福顺缘</span><span style="font-size:14px;">作为时尚男装布鞋行业优秀品牌,其收录代表产品[</span><span style="font-size:14px;">福顺缘</span><span style="font-size:14px;">老北京布鞋8323冬季宽松时尚男棉鞋橡胶底防滑耐磨休闲男鞋]进入市场福顺缘高端品质精湛工艺,福顺缘老北京布鞋-质量保证,买家100%放心。</span>\r\n</h1>', 0, 255, 1419517616, 0, 1, '', '', ''),
(69, 5, '意斯图威简介 意斯图威品牌介绍 意斯图威旗舰店 意斯图威发展史', '小编', '&nbsp;&nbsp;&nbsp;<span style="font-size:14px;">&nbsp; </span><span style="font-size:14px;"><strong>“ISTOWAY</strong></span><span style="font-size:14px;"><strong>意斯图威</strong></span><span style="font-size:14px;"><strong>”</strong>是广州正在广告传媒有限公司（正在传媒ISTOMEDIA）于2010年自主创立的时尚品牌，主走电子商务“快速时尚”的连锁销售路线。</span><br />\r\n<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-size:14px;">&nbsp;正在传媒ISTOMEDIA公司旗下同时还拥有“施欧”以及“ISTOBUY正在购物”两大品牌。“ISTOWAY”是由三个英文单词“IS”“ TO”“ WAY”组合而成，寓意“走自己的路成就理想”，中文名称内涵：“意”：意念，创意；“斯”：在这里，专心，专注；“图”：励精图治，勤恳耕耘；“威”：立行业之先，扬品质之优。“意斯图威”代表着为消费者提供优质服务，立志成为中国网络消费市场最值得信赖的品牌，以励志的<strong>品牌文化</strong>，创新的设计理念深深渗入到产品品质和服务，不断的提升品牌的形象，并深得广大消费者的关心和支持。品牌名称凝聚了正在传媒ISTOMEDIA创始人王武鑫先生倡导的励志品牌文化以及对时尚品质的专注。ISTOWAY的出现只为打造一个高品质、低消费的<strong>年轻时尚</strong>品牌，由多个专业设计师提供设计样板，并在全球各地设有专业买手，全新主走时尚品牌路线率先在电子商务的领域推行“时尚不惑”的励志品牌文化，让城市时尚人群对自己的时尚定位不再模糊。</span>', 0, 255, 1419518831, 0, 1, '', '', ''),
(70, 5, '金格瑞服饰旗舰店_金格瑞服饰简介_金格瑞服饰品牌介绍-金格瑞发展历史', '小编', '<p>\r\n	<span style="color:#222222;"><span style="font-size:16px;"><strong>金格瑞简介：</strong></span><span style="font-family:Helvetica, Arial, sans-serif;"></span></span>\r\n</p>\r\n<p>\r\n	<span style="color:#222222;"><span style="font-family:Helvetica, Arial, sans-serif;"><span style="font-size:14px;">&nbsp;&nbsp;&nbsp; </span><span style="font-size:14px;">金格瑞是国内知名的服饰品牌，拥有自主品牌独立的设计师团队，金格瑞的衣服不但时尚潮流，质量更是站在业内的顶峰，而且性价比高，金格瑞品牌开建旗舰店之后，深受消费者青睐，销量直线上升。如果想买金格瑞牌子衣服的话，建议到金格瑞的旗舰店买，因为是厂家直营，价格质量均得保障。</span></span></span>\r\n</p>\r\n<p>\r\n	<span style="font-size:14px;">&nbsp;&nbsp;&nbsp; </span><span style="font-size:14px;">金格瑞服饰旗舰店是天猫优秀店铺。金格瑞服饰旗舰店致力为用户提供诚信、优质的服务。自开店以来，深受买家们的喜爱。同时，秉承客户至上的原则，欢迎各位买家对我们金格瑞服饰品牌的服务进行监督和反馈。</span>\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>', 0, 255, 1419519304, 0, 1, '', '', '');
