(2, '联系我们', '<p style="padding-bottom:0px;line-height:30px;background-color:#ffffff;margin-top:0px;padding-left:0px;padding-right:0px;font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;white-space:normal;margin-bottom:0px;color:#5e5e5e;padding-top:0px;">\r\n	　　58必淘　[<a style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;color:#5e5e5e;padding-top:0px;" href="http://www.16iu.com/" target="_blank">58bitao.com</a>]\r\n</p>\r\n<p style="padding-bottom:0px;line-height:30px;background-color:#ffffff;margin-top:0px;padding-left:0px;padding-right:0px;font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;white-space:normal;margin-bottom:0px;color:#5e5e5e;padding-top:0px;">\r\n	　　如果您对我们的网站以及服务有任何疑问、意见或建议，请随时与我们在线客服取得联系！我们的客服人员会给您详尽细致的解答，您的意见或建议将立即得到反馈。\r\n</p>\r\n<p style="padding-bottom:0px;line-height:30px;background-color:#ffffff;margin-top:0px;padding-left:0px;padding-right:0px;font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;white-space:normal;margin-bottom:0px;color:#5e5e5e;padding-top:0px;">\r\n	　　工作时间：周一至周五（09：00 - 12：00　14：00 - 18：00）\r\n</p>\r\n<p style="padding-bottom:0px;line-height:30px;background-color:#ffffff;margin-top:0px;padding-left:0px;padding-right:0px;font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;white-space:normal;margin-bottom:0px;color:#5e5e5e;padding-top:0px;">\r\n	&nbsp; &nbsp; &nbsp; 联系方式：<a href="http://wpa.qq.com/msgrd?v=3&amp;uin=89677070&amp;site=qq&amp;menu=yes" target="_blank"><img title="点击这里给我发消息" border="0" alt="点击这里给我发消息" src="http://wpa.qq.com/pa?p=2:89677070:51" /></a> \r\n</p>\r\n<p style="padding-bottom:0px;line-height:30px;background-color:#ffffff;margin-top:0px;padding-left:0px;padding-right:0px;font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;white-space:normal;margin-bottom:0px;color:#5e5e5e;padding-top:0px;">\r\n	&nbsp;&nbsp;&nbsp;&nbsp; 手机：15858933211\r\n</p>', '58必购网 年货网 年货团购网', '58必购网 年货网 年货团购网', '58必购网 年货网 年货团购网', 1418043327),
(3, '免责声明', '<p>\r\n	尊敬的用户：<br />\r\n您即将通过本页面确认使用58必淘（以下简称：必淘网）以外的第三方卖家为您提供的商品和相关服务需注意的相关事项。在接受本须知内容之前，请您仔细阅读本须知的 全部内容如果您对本须知的条款有疑问的，请通过必淘网客服渠道进行询问，必淘网将向您解释条款内容。如果您不同意本须知的任意内容，或者无法准确理解必淘网对条款的解释，请不要进行后续操作。<br />\r\n必淘网使用须知（简称“本须知”）是必淘网用户(以下简称“用户”或“您”)就使用基于在必淘网的卖家（以下简称“卖家”）提供相关商品或服务所签署的有效文件。用户通过网络页面点击确认或以其他方式选择接受本须知，即表示您同意接受以下全部内容： <br />\r\n1．在您在本网站中与卖家产生的所有交易，均在淘宝网、天猫、京东商城等平台内进行，对于交易过程中的资金及个人信息的安全问题，均由淘宝网、天猫、京东商城等平台负责，本网站不承担任何交易过程产生的资金及个人信息安全问题的责任。 <br />\r\n2．卖家提供的产品和服务由卖家独立负责。在交易过程中遇到任何质量或者服务问题，均可以按照正常的淘宝等平台维权流程进行维权，本网站不对卖家提供的商品或服务承担任何责任。 <br />\r\n3．为了保障您的权益，本网站将定期对卖家提供的商品宣传进行检查，但您理解检查不可能每时每刻都在进行。所以，请您仔细阅读卖家对商品的各种宣传资料，对其做出准确判断。本网站对卖家所涉及的商品和服务任何内容、宣传、和其他材料未作认证，也不对此负责或承担任何责任。 <br />\r\n4．网络欺诈往往会模仿、仿冒淘宝、天猫、京东等网站登录页面的样式制作视觉感相似的页面诱导您输入账号和密码等信息，必淘网提醒您防范网络风险，不要向任何人士（包括卖家）透露淘宝、天猫、京东商城的账号、密码等相关信息。 <br />\r\n5．您理解并同意，必淘网仅提供淘宝、天猫卖家的商品链接，对于卖家的商品服务的选择和交易的内容，应由您自行判断，且审慎交易。您需自行了解卖家提供的商品或服务的功能、收费标准、退款规则、服务有效期等情况并注意交易风险。必淘网不对卖家和用户行为的合法性、有效性及卖家提供商品和服务的真实性、合法性和有效性作任何明示和默示的担保。必淘网用户与卖家产生纠纷时将努力进行协调，卖家也应秉承为用户提供优质商品和服务的理念为用户提供便利，但必淘网并不保证协调取得实际效果。 <br />\r\n6．如您发现卖家侵犯您的合法权益的，或您不幸遭遇网络欺诈的，请及时联系淘宝等相关网站，本网站会协助您维护您的合法权益。\r\n</p>\r\n<br />', '', '', '', 1418043415),
