vetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					一件商品只上一次\r\n				</td>\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					一件商品只上一次\r\n				</td>\r\n			</tr>\r\n			<tr style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" bgcolor="#ffffff">\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					店内客服\r\n				</td>\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					必须在线\r\n				</td>\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					必须在线\r\n				</td>\r\n			</tr>\r\n			<tr style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" bgcolor="#ffffff">\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					优先通过\r\n				</td>\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					品牌、价值较大商品\r\n				</td>\r\n				<td style="border-bottom:#aaaaaa 1px dotted;border-left:#aaaaaa 1px dotted;padding-bottom:0px;text-indent:12px;margin:0px;padding-left:0px;padding-right:0px;font:12px/1.5 Tahoma,Helvetica,Arial,宋体,sans-serif;border-top:#aaaaaa 1px dotted;border-right:#aaaaaa 1px dotted;padding-top:0px;">\r\n					品牌、价值较大商品\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n<span style="font-family:Tahoma,Helvetica,Arial,宋体,sans-serif;color:#5e5e5e;"><span style="line-height:30px;"><br />\r\n</span></span> \r\n</p>\r\n<strong><span style="font-size:16px;">二、活动流程</span></strong> \r\n<p style="padding-bottom:0px;widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;padding-left:0px;padding-right:0px;font:12px/30px Tahoma,Helvetica,Arial,宋体,sans-serif;word-wrap:break-word;white-space:normal;orphans:2;letter-spacing:normal;color:#5e5e5e;word-spacing:0px;padding-top:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;" class="sphz_p">\r\n	1、商家认真查看活动要求说明进行报名。<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n2、准确填写报名信息，提交报名，我们会在三天内进行审核，请关注自己的报名后台查看审核结果。。<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n3、审核通过的活动，我们会联系商家，沟通活动准备工作及上线排期等问题。\r\n</p>\r\n<p style="padding-bottom:0px;widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;padding-left:0px;padding-right:0px;font:12px/30px Tahoma,Helvetica,Arial,宋体,sans-serif;word-wrap:break-word;white-space:normal;orphans:2;letter-spacing:normal;color:#5e5e5e;word-spacing:0px;padding-top:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;" class="sphz_p">\r\n	<br />\r\n</p>\r\n<strong><span style="font-size:16px;">三、黑名单</span></strong> \r\n<p style="padding-bottom:0px;widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;padding-left:0px;padding-right:0px;font:12px/30px Tahoma,Helvetica,Arial,宋体,sans-serif;word-wrap:break-word;white-space:normal;orphans:2;letter-spacing:normal;color:#5e5e5e;word-spacing:0px;padding-top:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;" class="sphz_p" sphz_p_er="">\r\n	1、拉黑原因（重要）&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n如果商家有以下行为，我们将终止与该商家合作，并将该商家列入黑名单永不合作。 我们真诚的提醒您，诚信合作，拉黑对您对我们都是损失！&nbsp;<span style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;">1.1、绕圈报名上活动，同款商品刻意联系不同专员审核者，发现即拉黑，活动随时终止；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.2、未按约定排期上架宝贝，修改宝贝价格、宝贝标题，活动时间以及添加我们的宣传图片；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.3、活动中单方面将宝贝下架；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.4、活动中单方面修改价格或包邮情况；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.5、活动中删除宝贝标题中的【58必淘独享】，或是删除我们的宣传图片或链接；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.6、活动期间同时参加其他促销活动；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.7、售卖假货或劣质产品等欺骗消费者的行为；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.8、未履行相应的售后服务，未能及时恰当处理用户投诉问题；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.9、活动期间悬挂过多其他活动宣传图片，恶意引导用户，造成用户误解的行为；&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n1.10、其他不诚信以及违规行为，最终解释权归本活动所有。&nbsp;</span>2、其他说明&nbsp;<span style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;">2.1、加入黑名单的商家，本活动永不合作，且无法删除此黑名单。&nbsp;<br style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" />\r\n2.2、黑名单由招商专员或活动排查专员添加。</span> \r\n</p>\r\n<p style="padding-bottom:0px;widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;padding-left:0px;padding-right:0px;font:12px/30px Tahoma,Helvetica,Arial,宋体,sans-serif;word-wrap:break-word;white-space:normal;orphans:2;letter-spacing:normal;color:#5e5e5e;word-spacing:0px;padding-top:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;" class="sphz_p" sphz_p_er="">\r\n	<span style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;"><br />\r\n</span> \r\n</p>\r\n<strong><span style="font-size:16px;">四、联系方式</span></strong> \r\n<p style="padding-bottom:0px;widows:2;text-transform:none;background-color:#ffffff;text-indent:0px;margin:0px;padding-left:0px;padding-right:0px;font:12px/30px Tahoma,Helvetica,Arial,宋体,sans-serif;word-wrap:break-word;white-space:normal;orphans:2;letter-spacing:normal;color:#5e5e5e;word-spacing:0px;padding-top:0px;-webkit-text-size-adjust:auto;-webkit-text-stroke-width:0px;" class="sphz_p" sphz_p_linx="">\r\n	<span style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;" class="sphz_span"><strong style="padding-bottom:0px;margin:0px;padding-left:0px;padding-right:0px;padding-top:0px;">商务合作QQ：</strong>408371488</span> \r\n</p>', '', '', '', 1418384692),
