(8, 4, '男士商务钱包多卡位手包', '1412/07/548457bfa30df_s.jpg', 990, 10, 1, 0, '24712593062', 98.00, 49.00, '钱包品质优良、款式时尚、是每个商务男士的首选贴身用品！', 1, 1420077600, 1427853600, NULL),
(9, 4, '欧美经典女包名媛首选单肩斜挎包！', '1412/07/5484591fcdcfc_s.jpg', 3000, 5, 1, 0, 'http://item', 128.00, 78.00, '这是经典的复古式女士单肩包、做工精致、款式大方、是时尚女士的休闲首选用包！', 2, 1420077600, 1429063200, NULL),
