('reg_protocol', '加入和使用58必购网平台表明您已经阅读并同意本使用条款，您的会员活动会遵从本使用条款。本协议由您与58必购网共同缔结，本协议具有合同效力。\r\n　　\r\n　　本协议中协议双方合称协议方，58必购网在协议中亦称为“58必购网”。　\r\n　\r\n　　一、协议内容及签署　　\r\n\r\n　　1、本协议内容包括协议正文及所有58必购网已经发布的或将来可能发布的各类规则，包括但不仅限于网站公告及帮助在内的官方声明。所有规则为本协议不可分割的组成部分，与协议正文具有同等法律效力。除另行明确声明外，任何58必购网及其关联公司提供的服务均受本协议约束。\r\n\r\n　　2、您应当在使用58必购网服务之前认真阅读全部协议内容，如您对协议有任何疑问的，应向58必购网咨询。但无论您事实上是否在使用58必购网服务之前认真阅读了本协议内容，只要您使用58必购网服务，则本协议即对您产生约束，届时您不应以未阅读本协议的内容或者未获得58必购网对您问询的解答等理由，主张本协议无效，或要求撤销本协议。\r\n\r\n　　3、58必购网有权根据需要不时地制订、修改本协议及/或各类规则，并以网站公示的方式进行公告，不再单独通知您。变更后的协议和规则一经在网站公布后，立即自动生效。修改后的使用协议一旦在网页上公布即有效代替原来的使用协议。此外，当您使用58必购网特殊服务时，您和我们应遵守58必购网随时公布的与该服务相关的指引、公告以及规则。前述所有的指引、公告以及规则，均构成本使用协议的一部分。如您不同意相关变更，应当立即停止使用58必购网服务。您继续使用58必购网服务的，即表示您接受经修订的协议和规则。\r\n\r\n　　4、您应当是具备完全民事权利能力和完全民事行为能力的自然人、法人或其他组织。若您不具备前述主体资格，则您及您的监护人应承担因此而导致的一切后果，且58必购网有权注销（永久冻结）您的58必购网账户，并向您及您的监护人索偿。\r\n\r\n　　5、您承诺接受并遵守本协议的约定。如果您不同意本协议的约定，您应立即停止注册程序或停止使用58必购网服务。您一旦使用58必购网服务，即视为您已了解并完全同意本使用协议各项内容，包括58必购网对使用协议随时所做的任何修改，并成为58必购网用户（以下简称“用户”）。\r\n\r\n　　二、58必购网服务使用规范\r\n\r\n　　1、遵守法律\r\n\r\n　　您同意遵守中华人民共和国相关法律法规的所有规定，并对以任何方式使用您的密码和您的帐号使用本服务的任何行为及其结果承担全部责任。如您的行为违反国家法律和法规的任何规定，有可能构成犯罪的，将被追究刑事责任，并由您承担全部法律责任。\r\n　　同时如果58必购网有理由认为您的任何行为，包括但不限于您的任何言论和其它行为违反或可能违反国家法律和法规的任何规定，58必购网可在任何时候不经任何事先通知终止向您提供服务。\r\n\r\n　　2、您的注册义务为了能使用本服务，您同意以下事项：依本服务注册提示请您填写正确的注册邮箱、密码和名号，并确保今后更新的登录邮箱、名号、头像等资料的有效性和合法性。若您提供任何违法、不道德或58必购网认为不适合在58必购网上展示的资料；或者58必购网有理由怀疑您的资料属于程序或恶意操作，58必购网有权暂停或终止您的帐号，并拒绝您于现在和未来使用本服务之全部或任何部分。58必购网无须对任何用户的任何登记资料承担任何责任，包括但不限于鉴别、核实任何登记资料的真实性、正确性、完整性、适用性及/或是否为最新资料的责任。\r\n\r\n　　3、用户帐号、密码及安全\r\n\r\n　　完成本服务的注册程序并成功注册之后，您可使用您的账号和密码，登录到您在58必购网的帐户（下称“帐号”）。保护您的帐号安全，是您的责任。\r\n　　您应对所有使用您的密码及帐号的活动负完全的责任。您同意：\r\n\r\n　　1）您的58必购网帐号遭到未获授权的使用，或者发生其它任何安全问题时，您将立即通知58必购网；\r\n\r\n　　2）如果您未保管好自己的帐号和密码，因此而产生的任何损失或损害，58必购网无法也不会承担任何责任；\r\n\r\n　　3）每个用户都要对其帐号中的所有行为和事件负全责。如果您未保管好自己的帐号和密码而对您、58必购网或第三方造成了损害，您将负全部责任。\r\n\r\n　　4、58必购网隐私权政策，您提供的登记资料及58必购网保留的有关您的若干其它资料将受到中国有关隐私的法律和本公司《隐私声明》之规范。\r\n\r\n　　5、提供者之责任\r\n\r\n　　根据有关法律法规，58必购网在此郑重提醒您注意，任何经由本服务而发布、上传的文字、资讯、资料、照片、图形、视讯、信息或其它资料（以下简称“内容 ”），无论是公开还是私下传送，均由内容提供者承担责任。58必购网仅为用户提供内容存储空间，无法控制经由本服务传送之内容，因此不保证内容的正确性、完整性或品质。您已预知使用本服务时，可能会接触到令人不快、不适当或令人厌恶之内容。在任何情况下，58必购网络均不为任何内容负责，但58必购网有权依法停止传输任何前述内容并采取相应行动，包括但不限于暂停用户使用本服务的全部或部分，保存有关记录，并向有关机关报告。\r\n\r\n　　6、用户行为\r\n\r\n　　用户同意将不会利用本服务进行任何违法或不正当的活动，包括但不限于下列行为∶\r\n　　1）用户不得发布或以其它方式传送含有下列内容之一的信息：\r\n　　* 反对宪法所确定的基本原则的；\r\n　　* 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；\r\n　　* 损害国家荣誉和利益的；\r\n　　* 煽动民族仇恨、民族歧视、破坏民族团结的；\r\n　　* 破坏国家宗教政策，宣扬邪教和封建迷信的；\r\n　　* 散布谣言，扰乱社会秩序，破坏社会稳定的；\r\n　　* 散布淫秽、色情、赌博、暴力、凶杀、恐怖、吸毒或者教唆犯罪的；\r\n　　* 侮辱或者诽谤他人，侵害他人合法权利的；\r\n　　* 含有虚假、诈骗、有害、胁迫、侵害他人隐私、骚扰、侵害、中伤、粗俗、猥亵、或其它道德上令人反感的内容；\r\n　　* 含有中国法律、法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其它内容的；\r\n　　* 含有58必购网认为不适合在58必购网展示的内容；\r\n\r\n　　2）用户不得出现恶意注册恶意点击等行为。严禁通过购买产品恶意取消订单等非法手段来提高个人收入，一经发现，58必购网有权取消会员的资格，并追回已经支付的全部佣金，同时该用户必须承担由此给58必购网带来的所有损失。58必购网严禁各种针对58必购网活动的作弊行为。对于查实的作弊行为，我们将收回该账号全部的邀请奖励、取消邀请资格，给予一定处罚，并列入九块邮黑名单账户。作弊行为包括但不限于：使用相同的电脑、相同的IP地址在同一天内注册多个账号，以骗取奖励邀请的行为、以注册送钱或注册送奖励等利益诱导来骗取注册的行为。\r\n\r\n　　3）用户不得以任何方式危害他人的合法权益；冒充其他任何人或机构，或以虚假不实的方式陈述或谎称与任何人或机构有关发布或以其它方式传送相关内容；\r\n\r\n　　4）将依据任何法律或合约或法定关系（例如由于雇佣关系和依据保密合约所得知或揭露之内部资料、专属及机密资料）知悉但无权传送之任何内容加以发布、发送电子邮件或以其它方式传送；\r\n　　5）将侵害他人著作权、专利权、商标权、商业秘密、或其它专属权利（以下简称“专属权利”）之内容加以发布或以其它方式传送；\r\n\r\n　　6）将任何广告信函、促销资料、“垃圾邮件”、““滥发信件”、“连锁信件”、“直销”或其它任何形式的劝诱资料加以发布、发送或以其它方式传送；\r\n\r\n　　7）将设计目的在于干扰、破坏或限制任何计算机软件、硬件或通讯设备功能之计算机病毒（包括但不限于木马程序（trojan horses）、蠕虫（worms）、定时炸弹、删除蝇（cancelbots）（以下简称“病毒”）或其它计算机代码、档案和程序之任何资料，加以发布、发送或以其它方式传送；\r\n\r\n　　8）干扰或破坏本服务或与本服务相连线之服务器和网络，或违反任何关于本服务连线网络之规定、程序、政策或规范；\r\n\r\n　　9）跟踪、人肉搜索或以其它方式骚扰他人；\r\n\r\n　　10）故意或非故意地违反任何适用的当地、国家法律，以及任何具有法律效力的规则；\r\n\r\n　　11）未经合法授权而截获、篡改、收集、储存或删除他人个人信息、站内邮件或其它数据资料，或将获知的此类资料用于任何非法或不正当目的。\r\n\r\n　　您已认可58必购网未对用户的使用行为进行全面控制，您使用任何内容时，包括依赖前述内容之正确性、完整性或实用性时，您同意将自行加以判断并承担所有风险，而不依赖于58必购网。您同意58必购网依其自行之考虑，删除可经由本服务提供之违反本条款的或其它引起58必购网反感的任何内容。\r\n　　您了解并同意，58必购网依据法律法规的要求，或基于诚信为了以下目的或在合理必要范围内，认定必须将内容加以保存或揭露时，得加以保存或揭露：\r\n　　a）遵守法律程序；\r\n　　b）执行本使用协议；\r\n　　c）回应任何第三人提出的权利主张；\r\n　　d）保护58必购网、其用户及公众之权利、财产或个人安全；\r\n　　e）其它58必购网认为有必要的情况。\r\n\r\n　　7、国际使用之特别警告\r\n\r\n　　您已了解国际互联网的无国界性，同